pragma solidity >=0.4.20 <0.9.0;

contract cryptoDorea {

    bytes32 private _secretHash;
    string _test;

    // define constructor to get fund on deploy stage
    constructor(string memory _secret) payable {

        _test = _secret;
        _secretHash = keccak256(abi.encodePacked(_secret));

    }

    // get balance of contract address
    function getBalance() public view returns(uint256){
        return address(this).balance;
    }

    // Transfer Ether to Loyal Customers
    function pay(address recipient, uint256  amount, uint256 campaignCount, uint256 shoppingCount, string memory _secret) public payable{
        
        userAuthorized(_secret);

        require(amount <= address(this).balance, "Insufficient balance");

        if(shoppingCount >= campaignCount){       
            // Transfer Ether to the receipnt address
            bool success = payable(recipient).send(amount);
            require(success, "Transfer failed");
        }
        
    }

    function userAuthorized(string memory _secret) private view {
      
        require(keccak256(abi.encodePacked(_secret)) == _secretHash, "not Authorized!");
      
    }

    // for test: remove after production
    function test() public view returns (bytes32){
        return _secretHash;
    }

    
